import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";

function Dashboard() {
    const navigate = useNavigate();
    const [user, setUser] = useState(null);

    useEffect(() => {
        const accessToken = localStorage.getItem("accessToken");

        if (!accessToken) {
            navigate("/login"); // Redireciona para o login se não estiver autenticado
        } else {
            // Simula a busca de informações do usuário
            setUser({ name: "Usuário Exemplo" }); // Aqui você pode buscar do backend
        }
    }, [navigate]);

    const handleLogout = () => {
        localStorage.removeItem("accessToken"); // Remove o token de autenticação
        navigate("/login"); // Redireciona para a tela de login
    };

    return (
        <div>
            <h1>Dashboard</h1>
            {user && <p>Bem-vindo, {user.name}!</p>}
            <button onClick={handleLogout}>Sair</button>
        </div>
    );
}

export default Dashboard;
